import { InnerContainer, Picture } from '@/shared/ui';
import s from './InnerLayout.module.css';
interface InnerLayoutProps {
  image?: string;
  text?: ReactNode;
  title?: ReactNode;
  navigateTo?: string;
  className?: string;
  maw?: number;
}
export const InnerLayout = memo(({
  text,
  title,
  image,
  children,
