            <Container pb={80}>
                <InnerContainer className={s.wrapper}>
                    {image && <Picture cdn src={image} w={140} h={140} flex='auto' />}
                    <Stack w='100%' maw={maw} mx='auto'>
                        <Title order={2} className={s.title} hidden={!title}>
                            {title}
                        </Title>
                        <Text className={s.text} hidden={!text}>
                            {text}
                        </Text>
                        {children}
                    </Stack>
                </InnerContainer>
            </Container>
        </Box>);
